INSERT INTO `wap_product` VALUES (1,'BB Sta 100','/static/wap/images/suitOne1.png','/static/wap/images/suitOne1.png',1980,'南山是国内著名的面料供应商，在澳洲拥有4大牧场，原材料均使用高品质的澳洲美丽诺羊毛。|本款精选100%羊毛面料，支数100’s，提供黑、蓝、灰3款纯色面料选择。','半麻衬|对条对格|牛角扣子|防静电袖衬|腋下汗袋|裆部包边|华丽裤腰|假扣眼|袖口假开叉','2015-03-12 12:57:45','suit'),(2,'BB Sta 110','/static/wap/images/suitSecond1.png','/static/wap/images/suitSecond1.png',2980,'南山是国内著名的面料供应商，在澳洲拥有4大牧场，原材料均使用高品质的澳洲美丽诺羊毛。|本款精选羊毛混纺羊绒、桑蚕丝面料，支数110’s，提供黑、蓝、灰6款纯色或条纹面料选择。','半麻衬|对条对格|牛角扣子|防静电袖衬|腋下汗袋|裆部包边|华丽裤腰|假扣眼|袖口假开叉','2015-03-12 12:59:58','suit'),(3,'BB Pro 110','/static/wap/images/suitThird1.png','/static/wap/images/suitThird1.png',3980,'维达莱是始创于1663年的意大利顶级面料供应商，是欧洲享有盛名的顶级厂商之一。维达莱不仅使用拥有“金羊毛”标志认证的澳洲美丽诺羊毛，而且还是诸多国际大牌的高档战略合作厂商。|本款精选维达莱最经典的super 110’s纯羊毛面料，采用进口里布，提供6款不同纹理的精细烫染的面料选择。','手工驳头眼| 半麻衬|对条对格|牛角扣子|防静电袖衬|腋下汗袋|裆部包边|华丽裤腰|真扣眼|手工弓针|轻薄垫肩|手针钎裤边|袖口真开叉','2015-03-12 13:00:53','suit'),(4,'BB Pro 130','/static/wap/images/suitForth1.png','/static/wap/images/suitForth1.png',4980,'维达莱是始创于1663年的意大利顶级面料供应商，是欧洲享有盛名的顶级厂商之一。维达莱不仅使用拥有“金羊毛”标志认证的澳洲美丽诺羊毛，而且还是诸多国际大牌的高档战略合作厂商。|本款精选维达莱高支数的super 130’s纯羊毛面料，采用进口里布，提供12款不同纹理的精细烫染的面料选择。','手工驳头眼| 半麻衬|对条对格|牛角扣子|防静电袖衬|腋下汗袋|裆部包边|华丽裤腰|真扣眼|手工弓针|轻薄垫肩|手针钎裤边|袖口真开叉','2015-03-12 13:01:28','suit'),(5,'BB Smart','/static/wap/images/shirtOne1.png','/static/wap/images/shirtOne1.png',498,'鲁泰100%新疆长绒棉。','纯棉面料|顶级辅料|修身后省|天然贝壳扣','2015-03-12 13:03:28','shirt'),(7,'BB Star','/static/wap/images/shirtThird2.png','/static/wap/images/shirtThird2.png',998,'意大利进口Canclini 面料，100%埃及长绒棉。|Canclini 是拥有百年历史的意大利顶级衬衫面料供应商，是欧洲高级定制衬衫的风向标。','纯棉面料|顶级辅料|修身后省|天然贝壳扣|鹰爪扣缝制|手工嵌条缝合|可拆卸领撑','2015-03-12 13:05:32','shirt');
