INSERT INTO `web_footer` VALUES (1,'关于我们','ABOUT US','师兄的衣柜Bros.Bespoke，是北京岂曰无衣科技有限公司旗下的O2O正装定制品牌，最初创建于北大光华的地下咖啡厅，现已拥有在线定制平台、专业服务团队和实体体验店。这些，都是由北京大学2010级创业团队倾力打造的。|师兄的衣柜创始人发现，去商场里一件件试穿西服和衬衫是件无比痛苦的事，这样的时光为什么不能用于享受一杯咖啡？并且遗憾的是，纵使网上购物非常便捷，买到的衣服不合身也会让人苦恼不已。|这是我们做好师兄的衣柜最大的动力。这一年里，我们奔跑在追求完美的路上，得到了众多北大校友的好评，也获得了数十位北大教授的支持。我们力图用最便捷细致的服务，为每一位愿意体验定制的朋友打造一身专属正装，陪伴主人见证不平凡的时刻。','2015-06-25 02:22:48'),(2,'定制流程','Customization Process','西服定制周期为25天，我们承诺，100%满意，不合身全额退款。|我们承诺将在15个工作日内为您安排发货，全部订单均可享受免费的直接送货上门服务。','2015-06-25 02:23:04'),(3,'支付方式','Payment','我们为您提供现金、刷卡、支付宝、微信等多种支付方式。|暂时不支持分期付款，请您理解。|我们承诺每次定制让您100％满意，不合身将全额退款。','2015-06-25 02:23:20'),(4,'实体店铺','Physical Stores','丹棱SOHO店：北京市海淀区丹棱街6号丹棱SOHO 503（海淀黄庄地铁站A1口向西200米）|北大光华1号楼店：北京大学光华管理学院1号楼(B1楼咖啡厅内)','2015-06-25 02:23:37'),(5,'配送信息','Shipping Policy','西服和衬衫定制周期为15个工作日，节假日顺延。|我们承诺将在15个工作日内为您安排发货，全部订单均可享受免费的直接送货上门服务。','2015-06-25 02:23:54'),(6,'售后服务','SHFW','定制西服、衬衫免费修改，我们承诺，100%满意，不合身全额退款。|我们承诺将在15个工作日内为您安排发货，全部订单均可享受免费的直接送货上门服务。','2015-06-25 02:24:21'),(7,'FAQS','FAQS','西服定制周期为25天，我们承诺，100%满意，不合身全额退款。|我们承诺将在15个工作日内为您安排发货，全部订单均可享受免费的直接送货上门服务。','2015-06-25 02:24:34'),(8,'服务与隐私条款','FWTK','西服定制周期为25天，我们承诺，100%满意，不合身全额退款。|我们承诺将在15个工作日内为您安排发货，全部订单均可享受免费的直接送货上门服务。','2015-06-25 02:24:49');
