INSERT INTO `web_product_web` VALUES (1,'CANALI','NAVY PRINCE OF WALES CHECK WOOL SUIT','Canali\'s impeccable Italian craftsmanship is world-renowned, and this debonair wool suit is a fine example. This regular-fit piece comes in a Prince of Wales check in a dapper palette. Make an immaculate impression on smart occasions with a sleek silk tie and polished Oxford shoes. Shown here with an Etro shirt, a Drake\'s tie and pocket square and George Cleverley shoes.','Fits true to size. Take your normal size|Regular cut blazer, tailored for a more comfortable fit|Straight-leg, mid-rise trousers with unfinished hems|Model wears an IT 48|Model measures: chest 38\"/ 96cm, waist size 32, height 6\'1\"/ 185cm','Navy, indigo and black Prince of Wales check wool|Jacket: notched lapels, buttoned cuffs, chest pocket, two front flap pockets, three internal pockets, fully lined|Trousers: belt loops, four pockets, partially lined|Two button jacket, hook and zip-fastening trousers|100% wool; jacket lining: 100% cupro|Dry clean|Made in Italy','Find out more about our delivery options|Please try items in the comfort of your own home. If you don\'t like them, or they don\'t fit, we\'ll happily collect them from your home or office for free.','2015-06-29 11:13:38','suit','web/567319_01.jpg','/media/web/567319_01_thumbnail.jpg','web/567319_02.jpg','/media/web/567319_02_thumbnail.jpg','web/567319_03.jpg','/media/web/567319_03_thumbnail.jpg','web/567319_04.jpg','/media/web/567319_04_thumbnail.jpg','web/567319_05.jpg','/media/web/567319_05_thumbnail.jpg','web/567319_06.jpg','/media/web/567319_06_thumbnail.jpg','3','枪驳头','斜兜','侧开气','4','时尚款','里兜|笔兜','无褶','右边','内折边',NULL,NULL,NULL,NULL,NULL,NULL,NULL,12,2,9,0),(2,'DUNHILL','MIDNIGHT-BLUE SEISHIN SLIM-FIT PINSTRIPED WOOL SUIT','This midnight-blue wool version of Richard James\' \'Seishin\' suit has the design\'s standard attributes - namely a slim fit and sleeves, a shorter jacket length and flat-front trousers - but it\'s the interesting |blue mélange pinstripes that really set it apart. ','Fits true to size. Take your normal size|Regular cut blazer (drop 6), tailored for a comfortable fit|Straight-leg, mid-rise trousers with unfinished hems and adjustable at waist|Size UK 38 trousers have a hem width of approximately 8.4\"/21.5cm','Multicoloured wool|Jacket: navy felt undercollar, notched lapels, lightly padded shoulders, non-functioning buttoned cuffs, chest pocket, two front flap pockets, double vent, internal pockets, half-canvassed, fully lined|Trousers: adjustable side tabs, two front slant pockets, jetted back pocket, half-lined|Two button jacket, hook and zip-fastening trousers|100% wool; jacket lining: 100% cupro; trouser lining: 100% viscose|Dry clean','Find out more about our delivery options|Please try items in the comfort of your own home.| If you don\'t like them, or they don\'t fit, we\'ll happily collect them from your home or office for free.','2015-06-29 11:57:40','suit','web/574338_01.jpg','/media/web/574338_01_thumbnail.jpg','web/574338_02.jpg','/media/web/574338_02_thumbnail.jpg','web/574338_03.jpg','/media/web/574338_03_thumbnail.jpg','web/574338_04.jpg','/media/web/574338_04_thumbnail.jpg','web/574338_05.jpg','/media/web/574338_05_thumbnail.jpg','web/574338_06.jpg','/media/web/574338_06_thumbnail.jpg','3','枪驳头','斜兜','后开气','4','时尚款','里兜|笔兜','无褶','右边','内折边',NULL,NULL,NULL,NULL,NULL,NULL,NULL,16,2,9,0),(3,'HUNTSMAN','GREY SLIM-FIT WOOL SUIT','Established in 1849, Huntsman uses tailoring techniques that have remained unchanged for hundreds of years. Extensive workmanship has gone into creating this exquisite two-piece suit, with each stage being meticulously cut by hand. It\'s made from crisp pressed wool in a timeless grey tone that will serve you well for years to come.','Fits true to size. Take your normal size|Slim cut blazer (drop 6), tailored for a close fit|Slim-leg, mid-rise trousers with unfinished hems and adjustable at the waist|Size UK 38 trousers have a hem width of approxi